import '../Styling/Auth.css';
import Logo from '../IMGs/Logos/ChenoChatIcon.svg';

export default function Register(){
    return (
        <div class='auth-form'>
            <div className='auth-header'>
                <img src={Logo} class='auth-logo'/>
                <span class='auth-title'>Register</span>
                <div class='auth-description'>Create an account on ChenoChat, connect with friends and family and other people you may know today!</div>
            </div>
            <form className='register-container'>
                <label for='register-username'>Username</label>    
            </form>
        </div>
    )
}
